import React from 'react';

const FontAwesomeIcon = require('react-fontawesome');

const Arrows = props => {
    
    return (
        // <FontAwesomeIcon
        //     className='fa-right text-white'
        //     name="fas fa-angle-right"
        //     size='3x'
        // />
            
        <div className="arrows-wrapper">
            <span className="arrow-left" onClick={props.moveSliderLeft}></span>
            
            <span className="arrow-right" onClick={props.moveSliderRight} href="#"></span>
        </div>
    )
}

export default Arrows;
